import React from "react";
import {Link} from "react-router-dom";
import "./C.css";
import Service from "../service/Service";

class Css extends React.Component{
    constructor(props){
        super(props)
        this.state={
            csss:[]
        }
        this.state={
            csses:[]
        }
    }
    componentDidMount(){
        Service.getCss().then((response) => {
            this.setState({csss:response.data})

        });

    }
    componentDidMount(){
        Service.getCSs().then((response)=>{
            this.setState({csses:response.data})
        });
    }
    render(){
        return(
            <div>
                <div class="feed1">
                <h3>CSS Tutorials</h3>
                    {

                            this.state.csss.map(
                                css =>
                                <ul key={css.id}>
                                   <Link to=""><li>{css.name}</li></Link>
                                </ul>
                            )                       

                    }
                </div>
                <div>
                    <div class="content12">
                        <div>
                            {
                                this.state.csses.map(
                                    css =>
                                    <p>{css}</p>
                                )
                            }                                                        
                        </div>

                    </div>
                </div>
            </div>
        )
    }
}
export default Css;
